function Player({name,extend:extend={}}){this.id=`Player${"_"+Math.random().toString(36).substr(2,9)}`,this.name=name,this.created_at=Date.now(),this.characters=[];var extendKeys=Object.keys(extend);if(0<extendKeys.length)for(let index=0;index<extendKeys.length;index++){var element=extendKeys[index];this[element]=extend[element]}return this}